import Link from 'next/link';
import classList from './style/nav.module.scss';
const Nav = () => (
    <div className={classList.Navigation}>
        <Link href='/sell'>
            <a>Sell</a>
        </Link>
        <Link href='/'>
            <a className={classList.Navigation__link}>Home</a>
        </Link>
    </div>
)

export default Nav;
